import './App.css';
import Header from './Header';
import Post from './Post';
import { Routes, Route } from 'react-router-dom'
import Layout from './Layout';



function App() {
  return (
    <Routes>
      <Route index element={
        <Layout />
      }>
      </Route>

      <Route path={'/login'} element={
        <main>
          <Header />
          <div>Login Page</div>
        </main>
      }></Route>
      <Route path={'/register'} element={
        <main>
          <Header />
          <div>Register Page</div>
        </main>
      }></Route>

    </Routes>

  );
}

export default App;
